import React from 'react'
import styled from "styled-components";



const Profile = () => {
    return (
        <Body>
            
        <l class="fas fa-user-circle" ><h1>User name</h1><h1>Edit Profile</h1><br/><h2>0 post</h2>  </l>
       
      
        </Body>
    )
};
const Body =styled.main`
l{ font-size:921%;
    padding-left: 63px;
    padding-top: 34px;
    display: grid;
    grid-template-columns: repeat(4,1fr);
    flex-grow: 1;
    
    box-sizing: border-box;
   
    cursor: pointer;
}
h1{
    grid-template-columns: repeat(4,1fr);
   display:grid;
    padding-left: 4px;
    
    font-size:15%;
}
h2{
    font-size:15%;
   
    padding-left: 75%;
    box-sizing: border-box;
    
}



`




export default Profile
